function App() {
  const [games, setGames] = useState(mockGames.slice(0, 5));

  const filterGames = (ev: any) => {
    const query = ev.target.value;

    if (!query) {
      setGames(mockGames.slice(0, 5));
    }
    setGames(gms => {
      return gms.filter(el => el && el.title.toLocaleLowerCase().includes(query.toLowerCase()))
    })
  }

  const handleCardClick = (link: string | undefined) => {
    if (!link) {
      return;
    }
    window.open(link, '_blank');
  }

  return (
    <div className='cry-app wrapper'>
      <div className="header-top">
        <h1>My library</h1>
        <div className="search-holder">
          <img src={searchIcon}/>
          <input className="srch" placeholder="Find one" onInput={(e) => filterGames(e)}/>
        </div>
      </div>
      <div className="list-holder">
        {
          games.map(el =>
            <div className="main-card" key={el.id} onClick={() => handleCardClick(el.link)}>
              <div className="cd-image-holder">
                <img src={el.image} />
              </div>
              <div className="cd-title-holder">
                {el.title}
              </div>
              <div className="meta">
                <div className="light"/> {el.price}k online
              </div>
            </div>
          )
        }
        <div className="main-card btn">
          <span className="add-btn">+</span>
          <span className="add-btn-title">Add title</span>
        </div>
      </div>
    </div>
  );
}

export default App;
